import React from "react";
import styled from "styled-components";
import Menu from "./Components/Menu";

function App() {
  return (
    <Wrapper className="App">
      <Menu></Menu>
    </Wrapper>
  );
}

export default App;

const Wrapper = styled.div`
  background-color: blue;
`;
